import { Drawer} from "@mui/material";

const drawerStyle = {
    left: 20,
    top:17,
    height: '95%',
    width: '30%',
    boxShadow:'none'
}
const InfoDrawer = ({open, setOpen}) =>{  //object restructing


    const handleClose = ()=>{
        setOpen(false);
    }
    return(
        <Drawer
        open={open}
        onClose={handleClose}
        PaperProps = {{sx : drawerStyle}} 
        style={{zIndex:1500}}
        >
            Hello


        </Drawer>
    )
}

export default InfoDrawer;
